import React from "react"
// import ProjectCard from './ProjectCard.js'
import './App.css';
import Page from  './Page.js';

const films = [
  {image:merlot, title:"Merlot Doesn't Go with Seabass", category:"Narrative Short" , src:"https://vimeo.com/380157225", description: "role: director, writer", portfolio:false},
  {image:luk, title:"Strawberry Generation", category:"Music Video" , src:"https://vimeo.com/380157225", portfolio:false},
  {image:art, title:"Mystery", category:"Experimental", src:"https://vimeo.com/380157225",portfolio:false},
  {image:eop, title:"En Otro Paraiso", category:"Narrative Short", src:"https://vimeo.com/380157225", portfolio:false},
  { image:rem, title:"R.E.M.", category:"Narrative Short", src:"https://vimeo.com/331576114",portfolio:false},
  { image:nyc, title:"From Brooklyn to Queens", category:"Experimental", src:"https://vimeo.com/374696154", portfolio:false},
  {image:vice, title:"Vice // The Artist", category:"Commercial", src:"https://vimeo.com/360725411", portfolio:false},
  { image:cnn, title:"CNN // Explore the Extraordinary", category:"Commercial", src:"https://vimeo.com/361223832",portfolio:false} ,
]

function Project(props) {
  return (
    <Page className="project-page">
      <h1> Projects</h1>
    </Page>
  )
}


export default Project;
